function f = bodyForce(X)

global testcase kT Mesh diff_n diff_u Magnetic  axisym 

k = kT;
D = diff_n;
mu = diff_u;

% allocation
f = zeros(size(X));

% assign
x = X(:,1);
y = X(:,2);

xmax = Mesh.maxx;
xmin = Mesh.minx;
ymax = Mesh.maxy;
ymin = Mesh.miny;
% xm = 0.5*(xmax+xmin);
% ym = 0.5*(ymax+ymin);

xc = testcase.xc;
yc = testcase.yc;
xm = xc;
ym = yc;
%% bx = 0.1*Bx/|B| -- by = 0.1*By/|B|
switch testcase.n
    case 1
        %% Bx = 1, By = 1, n = 1, u = 1
        f(:,1) = 0;
        f(:,2) = 0;
    case 2
        %% Bx = 1, By = 1, n = x+1, u = 1
        f(:,1) = sqrt(0.2e1) / 0.20e2;
        f(:,2) = sqrt(0.2e1) / 0.20e2 + k * sqrt(0.2e1) / 0.20e2;
    case 3
        %% Bx = 1, By = 1, n = 1, u = x
        
        for i = 1:size(x)
            xx = x(i);
            f(i,1) = sqrt(0.2e1) / 0.20e2;
            f(i,2) = xx * sqrt(0.2e1) / 0.10e2;
        end
    case 4
        %% Bx = 1, By = 1, n = x+1, u = y
        for i = 1:size(x)
            xx = x(i);
            yy = y(i);
            f(i,1) = sqrt(0.2e1) * yy / 0.20e2 + (1 + xx) * sqrt(0.2e1) / 0.20e2;
            f(i,2) = yy ^ 2 * sqrt(0.2e1) / 0.20e2 + (1 + xx) * yy * sqrt(0.2e1) / 0.10e2 + k * sqrt(0.2e1) / 0.20e2 + mu / 0.100e3;
        end
    case 5
        %% Bx = y, By = 1, n = 1, u = 1
        for i = 1:size(x)
            xx = x(i);
            yy = y(i);
            f(i,1) = -((yy ^ 2 + 1) ^ (-0.3e1 / 0.2e1) * yy) / 0.10e2;
            f(i,2) = -((yy ^ 2 + 1) ^ (-0.3e1 / 0.2e1) * yy) / 0.10e2;
        end
    case 6
        %% Circular field centered in [xc, yc], n=1, u=1
        for i = 1:size(x)
            xx = x(i);
            yy = y(i);
%             f(i,1) = -((yy - yc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.3e1 / 0.2e1) * (2 * xx - 2 * xc)) / 0.20e2 - ((-xx + xc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.3e1 / 0.2e1) * (2 * yy - 2 * yc)) / 0.20e2;
%             f(i,2) = -((yy - yc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.3e1 / 0.2e1) * (2 * xx - 2 * xc)) / 0.20e2 - ((-xx + xc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.3e1 / 0.2e1) * (2 * yy - 2 * yc)) / 0.20e2;
            f(i,1) = 0;
            f(i,2) = 0;

        end
    case 7
        %% Circular field centered in [xc, yc], n=x+1, u=1
        for i = 1:size(x)
            xx = x(i);
            yy = y(i);
            f(i,1) = ((yy - yc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.1e1 / 0.2e1)) / 0.10e2 - ((1 + xx) * (yy - yc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.3e1 / 0.2e1) * (2 * xx - 2 * xc)) / 0.20e2 - ((1 + xx) * (-xx + xc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.3e1 / 0.2e1) * (2 * yy - 2 * yc)) / 0.20e2 - D * (((yy - yc) ^ 2 / (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ 2 * (2 * xx - 2 * xc)) / 0.100e3 + ((-xx + xc) / (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ 2 * (yy - yc) * (2 * yy - 2 * yc)) / 0.100e3 - ((-xx + xc) / (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2)) / 0.100e3);
            f(i,2) = ((yy - yc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.1e1 / 0.2e1)) / 0.10e2 - ((1 + xx) * (yy - yc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.3e1 / 0.2e1) * (2 * xx - 2 * xc)) / 0.20e2 - ((1 + xx) * (-xx + xc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.3e1 / 0.2e1) * (2 * yy - 2 * yc)) / 0.20e2 + (k * (yy - yc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.1e1 / 0.2e1)) / 0.10e2 - mu * (((yy - yc) ^ 2 / (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ 2 * (2 * xx - 2 * xc)) / 0.100e3 + ((-xx + xc) / (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ 2 * (yy - yc) * (2 * yy - 2 * yc)) / 0.100e3 - ((-xx + xc) / (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2)) / 0.100e3);
        end
    case 8
        %% Circular field centered in [xc, yc], n=x+1, u=y
        for i = 1:size(x)
            xx = x(i);
            yy = y(i);
            f(i,1) = ((yy - yc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.1e1 / 0.2e1) * yy) / 0.10e2 - ((1 + xx) * yy * (yy - yc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.3e1 / 0.2e1) * (2 * xx - 2 * xc)) / 0.20e2 + ((1 + xx) * (-xx + xc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.1e1 / 0.2e1)) / 0.10e2 - ((1 + xx) * yy * (-xx + xc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.3e1 / 0.2e1) * (2 * yy - 2 * yc)) / 0.20e2 - D * (((yy - yc) ^ 2 / (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ 2 * (2 * xx - 2 * xc)) / 0.100e3 + ((-xx + xc) / (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ 2 * (yy - yc) * (2 * yy - 2 * yc)) / 0.100e3 - ((-xx + xc) / (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2)) / 0.100e3);
            f(i,2) = (yy ^ 2 * (yy - yc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.1e1 / 0.2e1)) / 0.10e2 - ((1 + xx) * yy ^ 2 * (yy - yc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.3e1 / 0.2e1) * (2 * xx - 2 * xc)) / 0.20e2 + ((1 + xx) * yy * (-xx + xc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.1e1 / 0.2e1)) / 0.5e1 - ((1 + xx) * yy ^ 2 * (-xx + xc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.3e1 / 0.2e1) * (2 * yy - 2 * yc)) / 0.20e2 + (k * (yy - yc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.1e1 / 0.2e1)) / 0.10e2 - mu * ((yy - yc) * ((yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.3e1 / 0.2e1)) * (((yy - yc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.1e1 / 0.2e1) * yy) / 0.10e2 + ((1 + xx) * (-xx + xc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.1e1 / 0.2e1)) / 0.10e2) * (2 * xx - 2 * xc) / 0.20e2 - (yy - yc) * ((yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.1e1 / 0.2e1)) * (-((yy - yc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.3e1 / 0.2e1) * yy * (2 * xx - 2 * xc)) / 0.20e2 + ((-xx + xc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.1e1 / 0.2e1)) / 0.10e2 - ((1 + xx) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.1e1 / 0.2e1)) / 0.10e2 - ((1 + xx) * (-xx + xc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.3e1 / 0.2e1) * (2 * xx - 2 * xc)) / 0.20e2) / 0.10e2 + (-xx + xc) * ((yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.3e1 / 0.2e1)) * (((yy - yc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.1e1 / 0.2e1) * yy) / 0.10e2 + ((1 + xx) * (-xx + xc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.1e1 / 0.2e1)) / 0.10e2) * (2 * yy - 2 * yc) / 0.20e2 - (-xx + xc) * ((yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.1e1 / 0.2e1)) * (((yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.1e1 / 0.2e1) * yy) / 0.10e2 - ((yy - yc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.3e1 / 0.2e1) * yy * (2 * yy - 2 * yc)) / 0.20e2 + ((yy - yc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.1e1 / 0.2e1)) / 0.10e2 - ((1 + xx) * (-xx + xc) * (yy ^ 2 - 2 * yy * yc + yc ^ 2 + xx ^ 2 - 2 * xx * xc + xc ^ 2) ^ (-0.3e1 / 0.2e1) * (2 * yy - 2 * yc)) / 0.20e2) / 0.10e2);
        end
    case 9
        %% Circular field centered in [xc, yc], n = 2+sin(wx*x ).*sin(wy*y)
        %% u = cos(wx*x).*cos(wy*y)
        a = testcase.wavex;
        b = testcase.wavey;
        a = a*2*pi;
        b = b*2*pi;
        for i = 1:numel(x)
            xx = x(i);
            yy = y(i);
            
            t1 = cos(a*xx)*cos(a*yy);
            t2 = sin(a*xx)*sin(a*yy);
            t3 = cos(a*xx)*sin(a*yy);
            t4 = cos(a* yy)*sin(a* xx);
            t5 = cos(a* yy)*sin(a* yy);
            t8 = cos(a*xx)^2* cos(a*yy)^2;
            ta = (xm^2-2*ym*yy-2*xm*xx +xx^2+ym^2+yy^2+1);
            f(i,1) = (2*D*a^2*sin(a*xx)*sin(a*yy) - 2*a*xm*cos(a*xx)*sin(a*yy)*((xm - xx)^2 + (ym - yy)^2 + 1)^(1/2) + 2*a*xx*cos(a*xx)*sin(a*yy)*((xm - xx)^2 + (ym - yy)^2 + 1)^(1/2) + 2*a*ym*cos(a*yy)*sin(a*xx)*((xm - xx)^2 + (ym - yy)^2 + 1)^(1/2) - 2*a*yy*cos(a*yy)*sin(a*xx)*((xm - xx)^2 + (ym - yy)^2 + 1)^(1/2) + D*a^2*xm^2*sin(a*xx)*sin(a*yy) + D*a^2*xx^2*sin(a*xx)*sin(a*yy) + D*a^2*ym^2*sin(a*xx)*sin(a*yy) + D*a^2*yy^2*sin(a*xx)*sin(a*yy) + D*a*xm*cos(a*xx)*sin(a*yy) - D*a*xx*cos(a*xx)*sin(a*yy) + D*a*ym*cos(a*yy)*sin(a*xx) - D*a*yy*cos(a*yy)*sin(a*xx) + a*xm*cos(a*xx)*cos(a*yy)^2*sin(a*xx)*((xm - xx)^2 + (ym - yy)^2 + 1)^(1/2) - a*xx*cos(a*xx)*cos(a*yy)^2*sin(a*xx)*((xm - xx)^2 + (ym - yy)^2 + 1)^(1/2) - a*ym*cos(a*xx)^2*cos(a*yy)*sin(a*yy)*((xm - xx)^2 + (ym - yy)^2 + 1)^(1/2) + a*yy*cos(a*xx)^2*cos(a*yy)*sin(a*yy)*((xm - xx)^2 + (ym - yy)^2 + 1)^(1/2) - a*xm*cos(a*xx)*sin(a*xx)*sin(a*yy)^2*((xm - xx)^2 + (ym - yy)^2 + 1)^(1/2) + a*xx*cos(a*xx)*sin(a*xx)*sin(a*yy)^2*((xm - xx)^2 + (ym - yy)^2 + 1)^(1/2) + a*ym*cos(a*yy)*sin(a*xx)^2*sin(a*yy)*((xm - xx)^2 + (ym - yy)^2 + 1)^(1/2) - a*yy*cos(a*yy)*sin(a*xx)^2*sin(a*yy)*((xm - xx)^2 + (ym - yy)^2 + 1)^(1/2) - 2*D*a^2*xm*ym*cos(a*xx)*cos(a*yy) + 2*D*a^2*xx*ym*cos(a*xx)*cos(a*yy) + 2*D*a^2*xm*yy*cos(a*xx)*cos(a*yy) - 2*D*a^2*xx*yy*cos(a*xx)*cos(a*yy) - 2*D*a^2*xm*xx*sin(a*xx)*sin(a*yy) - 2*D*a^2*ym*yy*sin(a*xx)*sin(a*yy))/((xm - xx)^2 + (ym - yy)^2 + 1);
            f(i,2) = ((a*mu*xx*sin(2*a*yy))/2 - (a*mu*xm*sin(2*a*yy))/2 - (a*mu*ym*sin(2*a*xx))/2 + (a*mu*yy*sin(2*a*xx))/2 - 2*a^2*mu*xm*ym + 2*a^2*mu*xx*ym + 2*a^2*mu*xm*yy - 2*a^2*mu*xx*yy + 4*a^2*mu*cos(a*xx)*cos(a*yy) + 4*a^2*mu*xm*ym*cos(a*xx)^2 - 4*a^2*mu*xx*ym*cos(a*xx)^2 - 4*a^2*mu*xm*yy*cos(a*xx)^2 + 4*a^2*mu*xx*yy*cos(a*xx)^2 + 4*a^2*mu*xm*ym*cos(a*yy)^2 - 4*a^2*mu*xx*ym*cos(a*yy)^2 - 4*a^2*mu*xm*yy*cos(a*yy)^2 + 4*a^2*mu*xx*yy*cos(a*yy)^2 + 2*a^2*mu*xm^2*cos(a*xx)*cos(a*yy) + 2*a^2*mu*xx^2*cos(a*xx)*cos(a*yy) + 2*a^2*mu*ym^2*cos(a*xx)*cos(a*yy) + 2*a^2*mu*yy^2*cos(a*xx)*cos(a*yy) - 2*a*mu*xm*cos(a*yy)*sin(a*xx) + 2*a*mu*xx*cos(a*yy)*sin(a*xx) - 2*a*mu*ym*cos(a*xx)*sin(a*yy) + 2*a*mu*yy*cos(a*xx)*sin(a*yy) + 8*a^2*mu*cos(a*xx)*cos(a*yy)*sin(a*xx)*sin(a*yy) - 2*a*xm*cos(a*xx)^2*cos(a*yy)*sin(a*xx)*(xm^2 - 2*ym*yy - 2*xm*xx + xx^2 + ym^2 + yy^2 + 1)^(1/2) + 2*a*xx*cos(a*xx)^2*cos(a*yy)*sin(a*xx)*(xm^2 - 2*ym*yy - 2*xm*xx + xx^2 + ym^2 + yy^2 + 1)^(1/2) + 4*a*ym*cos(a*xx)*cos(a*yy)^2*sin(a*xx)*(xm^2 - 2*ym*yy - 2*xm*xx + xx^2 + ym^2 + yy^2 + 1)^(1/2) - 4*a*xm*cos(a*xx)^2*cos(a*yy)*sin(a*yy)*(xm^2 - 2*ym*yy - 2*xm*xx + xx^2 + ym^2 + yy^2 + 1)^(1/2) + 4*a*xx*cos(a*xx)^2*cos(a*yy)*sin(a*yy)*(xm^2 - 2*ym*yy - 2*xm*xx + xx^2 + ym^2 + yy^2 + 1)^(1/2) - 4*a*yy*cos(a*xx)*cos(a*yy)^2*sin(a*xx)*(xm^2 - 2*ym*yy - 2*xm*xx + xx^2 + ym^2 + yy^2 + 1)^(1/2) + 2*a*ym*cos(a*xx)*cos(a*yy)^2*sin(a*yy)*(xm^2 - 2*ym*yy - 2*xm*xx + xx^2 + ym^2 + yy^2 + 1)^(1/2) - 2*a*yy*cos(a*xx)*cos(a*yy)^2*sin(a*yy)*(xm^2 - 2*ym*yy - 2*xm*xx + xx^2 + ym^2 + yy^2 + 1)^(1/2) - 8*a^2*mu*xm*ym*cos(a*xx)^2*cos(a*yy)^2 + 8*a^2*mu*xx*ym*cos(a*xx)^2*cos(a*yy)^2 + 8*a^2*mu*xm*yy*cos(a*xx)^2*cos(a*yy)^2 - 8*a^2*mu*xx*yy*cos(a*xx)^2*cos(a*yy)^2 + 3*a*xm*cos(a*xx)^2*cos(a*yy)^3*sin(a*xx)*(xm^2 - 2*ym*yy - 2*xm*xx + xx^2 + ym^2 + yy^2 + 1)^(1/2) - 3*a*xx*cos(a*xx)^2*cos(a*yy)^3*sin(a*xx)*(xm^2 - 2*ym*yy - 2*xm*xx + xx^2 + ym^2 + yy^2 + 1)^(1/2) - 3*a*ym*cos(a*xx)^3*cos(a*yy)^2*sin(a*yy)*(xm^2 - 2*ym*yy - 2*x